import axios from "axios";
import React, { useEffect, useState } from "react";
import { useHistory } from "react-router-dom";
import Detail from "../Detail/Detail";
import Clock from "../../images/clock.svg";
import { RightViewForecast ,RightViewHistory} from "../Home/CityDTO";
function RightHistory(props: any) {
  console.log("history");
  const dateUnix = Math.round(new Date().getTime() / 1000);
  const [history, setHistory] = useState<RightViewHistory[]>([]);
  useEffect(() => {
    console.log("use effect called");
    let histories:RightViewHistory[]=[];
    for (let i = 0; i < 5; i++) {
      axios
        .get(
          `https://api.openweathermap.org/data/2.5/onecall/timemachine?lat=${props.lat}&lon=${props.lon}&dt=${dateUnix-10-(i*86400)}&appid=a9c7a346f3196bdf3072d1b5efdb5a34`
        )
        .then((response) => {
          console.log(response);
        //    setHistory([...history,{response.}])
        })
        .catch((error) => console.log(error));
    }
    setHistory(histories);
  }, []);
  return <div></div>;
}
export default RightHistory;
